import React from 'react';
import Header from './Components/Header/Header';
import { Grid } from '@mui/material';

import "./App.css"

const App = () => {
  return (
    <>
      <Header/>
      <Grid container spacing={2}>
        <Grid item xs={6}>
             Home Page
          </Grid> 
          <Grid item xs={6}>
            Side Bar
          </Grid>


      </Grid>

    </>
  )
}

export default App
